import React from 'react';

export default function Services() {
  return (
    <div className="services">
      <h2 className="red">Our Services</h2>
      <ul>
        <li>Browse the restaurant menu with images and prices</li>
        <li>Add items to the cart</li>
        <li>Remove items from the cart</li>
        <li>View total price of the order</li>
        <li>Responsive design for desktop and mobile devices</li>
        <li>About and Contact pages with information and support</li>
      </ul>
    </div>
  );
}
